    false,nt"url": null,nt"notes": "This annual narrative report for Innoko
    NWR outlines Refuge accomplishments during the 1996 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses the master plan
    and management planning. Refuge administration is outlined; information about personnel,
    youth programs, volunteer programs, funding, and safety is given. Habitat management
    is also covered; subjects include fire management and water rights. The wildlife
    section of the report discusses waterfowl, game mammals, fisheries resources, and
    scientific collections. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, hunting, fishing, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, major maintenance, equipment replacement, communication
    systems, and computer systems. Cooperative programs are provided at the end.",nt"license_title":
